review:
GRIPTAPE BACKBONE

S k a t e b o a r d i n g  v a p o r w a v e  m e m e  s i m u l a t o r.

//Story//
Don't even kid yourself.

//Gameplay//
Very clunky skateboarding collect-a-thon.

//Visuals//
Memes everywhere and colors that make me feel as if i've slipped sewing needles into my pupils.

//Audio//
Music is a mixtape of various vaporwavy songs and other japanese music. (assuming as ive played a grand total of eleven minutes)

//Tone//
Irony in its most dense and refined form.

The main point of this game, and any game really, is to grab your attention and entertain you. For me this game failed at the latter. Griptapes comedy and entertainment factor is entirely based on debatably funny memes and the staggering ammount of cups you need to collect for the ending(assuming there is one). Call me boring but it just isn't funny to me. I get the meaning behind this game though, the goal is getting that sweet sweet dopamine from collecting those cups and getting there only burns time with no promise of a reward. It's the endgoal of any game and is nothing more than just that.

Reguardless, i know there are people who unironically and otherwise like this kind of style so i reccomend anyway.

8 jazzy cups of 10
